const InvoiceCard = ({ item }) => {
  return (
    <section key={item.id} className="invoices">
      <h3>{item.invoice_number}</h3>
      <p>Issued: {item.formatted_issued_date}</p>
      <p>Total Cost: {item.total_cost} CHF</p>
      <button>Download Invoice PDF</button>
    </section>
  );
};
export default InvoiceCard;
